import xicon from './x-icon.svg';

function x_icon(props) {
    return (
        <div className={props.class} id={props.id}>
            <img onClick={props.onMenuClick} src={xicon} width={props.width} height={props.height} alt="exit out of menu" />
        </div>
    );
};

export default x_icon;
